    if (x == undefined) x = y.map((yi, i) => i)   // row number (happens in plotly for empty x or y data)
    else if (y == undefined) y = x.map((yi, i) => i)
    yf = y.filter((yi, i) => xbeg < x[i] & x[i] < xend & isFinite(yi))
    return [Math.min(...yf), Math.max(...yf)]

        // better would be https://github.com/plotly/plotly.js/issues/4004
        if (evt.buttons == 4 && this._fullLayout.dragmode == 'zoom') {
            this._fullLayout.dragmode = 'pan'
            document.addEventListener('mouseup', function (evt) {
                // https://community.plotly.com/t/plotly-onmousedown-and-onmouseup/4812/4
                graph._fullLayout.dragmode = 'zoom'
            }, { 'once': true })
        }
        if (evt.buttons == 2) rubber_init(evt)
    }, true)
    // graph.on('plotly_relayout', function (data) {
    //     let currentRange = data['xaxis.range[1]'] - data['xaxis.range[0]'];
    //     let ratio = oriXrange / currentRange / 5;
    //     Plotly.restyle(myPlot, { textfont: { size: Math.min(originalTextSize * ratio, originalTextSize) } });
    // });
    graph.addEventListener("keydown", function (e) {
        if (e.target != this) { return } // e.g. to escape to edittext
        var key = e.key
        console.log(e, key)
        switch (key) {
            case 't':
                var tn = [];
                graph._fullData.forEach(trace => {
                    if (trace.mode === 'text') {
                        tn.push(trace.index);
                    }
                });
                Plotly.restyle(graph, { 'opacity': t_key % 2 == 0 ? 0 : 1 }, tn)
                t_key++;
                break
            case 'l':
                var tn = [];
                console.log(graph._fullData);
                graph._fullData.forEach(trace => {
                    if (trace.mode === 'lines' && trace.text == "1") {
                        tn.push(trace.index);
                    }
                });
                Plotly.restyle(graph, { 'opacity': l_key % 2 == 0 ? 0 : 1 }, tn)
                l_key++;
                break
            default: return
        }

        return false
    })
}

l_key = 0
